// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract LiquidityPool is ReentrancyGuard {
    address public tokenAddress;
    address public factory;
    uint256 public taxRate; // in percentage

    uint256 public reserveToken;
    uint256 public reserveEther;

    event Initialized(address tokenAddress, uint256 initialTaxRate);
    event TaxRateUpdated(uint256 oldRate, uint256 newRate);
    event Swap(address indexed user, uint256 inputAmount, uint256 outputAmount, string direction);
    event LiquidityAdded(address indexed provider, uint256 tokenAmount, uint256 etherAmount);

    modifier onlyFactory() {
        require(msg.sender == factory, "Only factory can call this function");
        _;
    }

    function initialize(
        address _tokenAddress,
        address _factory,
        uint256 initialSupply,
        uint256 initialTaxRate
    ) external payable {
        require(factory == address(0), "Already initialized");
        require(msg.value > 0, "Ether required for initialization");

        tokenAddress = _tokenAddress;
        factory = _factory;
        reserveToken = initialSupply;
        reserveEther = msg.value;
        taxRate = initialTaxRate;

        emit Initialized(tokenAddress, initialTaxRate);
    }

    function setTaxRate(uint256 newTaxRate) external onlyFactory {
        require(newTaxRate <= 100, "Tax rate cannot exceed 100%");
        uint256 oldRate = taxRate;
        taxRate = newTaxRate;
        emit TaxRateUpdated(oldRate, newTaxRate);
    }

    function swapTokensForEther(uint256 tokenAmount) external nonReentrant returns (uint256 etherOut) {
        require(tokenAmount > 0, "Token amount must be greater than zero");
        uint256 tax = (tokenAmount * taxRate) / 100;
        uint256 tokenAfterTax = tokenAmount - tax;
        etherOut = (tokenAfterTax * reserveEther) / reserveToken;

        reserveToken += tokenAmount;
        reserveEther -= etherOut;

        emit Swap(msg.sender, tokenAmount, etherOut, "Token to Ether");
    }

    function swapEtherForTokens() external payable nonReentrant returns (uint256 tokenOut) {
        require(msg.value > 0, "Ether amount must be greater than zero");
        uint256 tax = (msg.value * taxRate) / 100;
        uint256 etherAfterTax = msg.value - tax;
        tokenOut = (etherAfterTax * reserveToken) / reserveEther;

        reserveEther += msg.value;
        reserveToken -= tokenOut;

        emit Swap(msg.sender, msg.value, tokenOut, "Ether to Token");
    }
}

